import React from "react";
import notes from "../notes";

function Note(){
    return(notes.map(noteEntry =>{
    return(
        <div className = "note">
            <h1>{noteEntry.title}</h1>
            <p>{noteEntry.content}</p>
        </div>
    );
}));
}
export default Note ;
